class MemoryManager {
    constructor(memoryBuffer) {
        this.memoryBuffer = memoryBuffer;
    }

    checkMemoryUsage() {
        console.log(`Current memory usage: ${(this.memoryBuffer.buffer.byteLength / 1024 / 1024).toFixed(2)} MB`);
        console.log(`Total memory pages: ${this.memoryBuffer.buffer.byteLength / 65536}`);
    }

    growMemory(pages) {
        try {
            this.memoryBuffer.grow(pages);
            console.log(`Memory grown by ${pages} pages.`);
            this.checkMemoryUsage();
        } catch (e) {
            console.error('Failed to grow memory:', e);
        }
    }
}

const memoryManager = new MemoryManager(memoryBuffer);

class KDBushManager {
    constructor() {
        this.instances = new Map();
        this.cleanupInterval = setInterval(this.cleanup.bind(this), 60000);
    }

    async getInstance(key, numItems, nodeSize = 64) {
        if (!wasmReady) throw new Error("WASM module chưa sẵn sàng");

        if (!this.instances.has(key)) {
            const instance = new kdbushWasmModule.KDBush(numItems, nodeSize);
            this.instances.set(key, { instance, lastUsed: Date.now() });
        } else {
            this.instances.get(key).lastUsed = Date.now();
        }

        return this.instances.get(key).instance;
    }

    cleanup() {
        const now = Date.now();
        for (const [key, { lastUsed }] of this.instances.entries()) {
            if (now - lastUsed > 120000) {
                this.instances.delete(key);
            }
        }
    }

    stopCleanup() {
        clearInterval(this.cleanupInterval);
    }
}

const kdbushManager = new KDBushManager();

class KDBush {
    constructor(key, numItems, nodeSize = 64) {
        this.key = key;
        this.numItems = numItems;
        this.nodeSize = nodeSize;
        this.points = [];
        this.bitset = null;
    }

    async initBitSet() {
        this.bitset = new fastbitsetWasmModule.FastBitSet();
    }

    async add(x, y, id) {
        if (!this.bitset) {
            await this.initBitSet();
        }
        this.points.push({ x, y, id });
        this.bitset.add(id);
    }

    async finish() {
        if (!wasmReady) throw new Error("WASM module chưa sẵn sàng");
        if (!this.bitset) {
            await this.initBitSet();
        }
        this.kdbush = await kdbushManager.getInstance(this.key, this.numItems, this.nodeSize);
        this.points.forEach(point => {
            this.kdbush.add(point.x, point.y, point.id);
        });
        this.kdbush.finish();
    }

    range(minX, minY, maxX, maxY) {
        if (!wasmReady || !this.bitset) throw new Error("WASM module chưa sẵn sàng");
        const results = this.kdbush.range(minX, minY, maxX, maxY);
        return results.filter(id => this.bitset.has(id));
    }

    within(x, y, r) {
        if (!wasmReady || !this.bitset) throw new Error("WASM module chưa sẵn sàng");
        const results = this.kdbush.within(x, y, r);
        return results.filter(id => this.bitset.has(id));
    }

    clear() {
        this.points = [];
        if (this.bitset) {
            this.bitset.clear();
        }
    }
}

module.exports = KDBush;